DROP TABLE cliente;
CREATE TABLE cliente (cod int NOT NULL AUTO_INCREMENT, nome varchar(255), data_nascimento date NOT NULL, email varchar(255), PRIMARY KEY (cod)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
DROP TABLE dependente;
CREATE TABLE dependente (cod int NOT NULL AUTO_INCREMENT, cod_cliente int, nome varchar(255), data_nascimento date NOT NULL, email varchar(255), PRIMARY KEY (cod), INDEX dependente_fk1 (cod_cliente)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
DROP TABLE nomes;
CREATE TABLE nomes (nome varchar(255), nasc varchar(255)) ENGINE=InnoDB DEFAULT CHARSET=latin1;
ALTER TABLE dependente ADD CONSTRAINT dependente_fk1 FOREIGN KEY (cod_cliente) REFERENCES cliente (cod) ON DELETE CASCADE;
